return ['domain'=>NULL,'plural-forms'=>'nplurals=2; plural=(n != 1);','language'=>'de_CH','pot-creation-date'=>'2025-09-04 10:02-0500','po-revision-date'=>'2025-09-04 10:02-0500','translation-revision-date'=>'2025-09-04 10:02-0500','project-id-version'=>'ICS Calendar','x-generator'=>'Poedit 3.7','messages'=>['%1$sYou are running ICS Calendar in a WordPress Playground implementation.%2$s Because ICS Calendar is intended to run on a web server, some features may be unavailable or may not function properly.'=>'%1$sSie führen ICS Calendar in einer WordPress Playground-Implementierung aus%2$s Da ICS Calendar für die Ausführung auf einem Webserver vorgesehen ist, sind einige Funktionen möglicherweise nicht verfügbar oder funktionieren nicht ordnungsgemäß.','%1$sYour site is currently using a UTC offset-based timezone setting.%2$s This can produce time display errors in the %3$s plugin in locations that observe Daylight Saving Time. Please %4$schange your timezone setting%5$s to the city nearest your location, in the same timezone, for proper time display. See our %6$sdocumentation%7$s for additional information on this issue.'=>'%1$sDeine Website verwendet derzeit eine UTC-Zeitversatz-basierte Zeitzoneneinstellung.%2$s Dies kann zu Zeitanzeigefehlern im %3$s-Plugin an Orten führen, welche die Sommerzeit verwenden. Bitte ändere für eine korrekte Zeitanzeige %4$sdeine Zeitzoneneinstellung%5$s in die Stadt, die deinem Standort in der gleichen Zeitzone am nächsten liegt. Weitere Informationen zu diesem Thema findest du in der %6$sDokumentation%7$s.','Utilities'=>'Tools','Settings'=>'Einstellungen','User Guide'=>'Benutzerhandbuch','Support'=>'Unterstützung','Upgrade to PRO!'=>'Upgraden Sie auf die Pro-Version!','Show/hide all'=>'Alle ein-/ausblenden','ICS file could not be retrieved or was empty. Please verify URL is correct, and check your php.ini configuration to verify either cURL or allow_url_fopen is available. If you are using spaces to delimit multiple URLs, you may also wish to try using the pipe character instead. Affected URL:'=>'Die ICS-Datei konnte nicht abgerufen werden oder war leer. Überprüfen Sie, ob die URL korrekt ist, und überprüfen Sie Ihre php.ini-Konfiguration, um sicherzustellen, dass entweder cURL oder allow_url_fopen verfügbar ist. Wenn Sie Leerzeichen zum Trennen mehrerer URLs verwenden, können Sie auch versuchen stattdessen das Pipe-Zeichen zu verwenden. Betroffene URL:','Hide past events'=>'Vergangene Termine ausblenden','Show past events'=>'Vergangene Termine anzeigen','Contact:'=>'Kontakt:','Resources:'=>'Ressourcen:','Click for more...'=>'Klicken Sie für mehr...','Save to your calendar'=>'In Ihrem Kalender speichern','Cancelled'=>'Abgesagt','The legacy parser option is deprecated and will be removed in a future update.'=>'Die Legacy-Parser-Option ist veraltet und wird in einem zukünftigen Update entfernt werden.','The "currentweek" shortcode attribute is deprecated. Please use view="week" in your shortcode instead.'=>'Das Shortcode-Attribut "currentweek" ist veraltet. Bitte verwenden Sie stattdessen view="week" in Ihrem Shortcode.','The "legendinline" shortcode attribute is deprecated. Please use legendstyle="inline" in your shortcode instead.'=>'Das Shortcode-Attribut "legendinline" ist veraltet. Bitte verwende stattdessen legendstyle="inline" in deinem Shortcode.','Cleared %1$s %2$s transient(s).'=>'Gelöscht %1$s %2$s Transiente(n).','No %1$s transients were found.'=>'Es wurden keine %1$s-Transienten gefunden.','Your feed URL appears to contain HTTP Basic Authentication credentials. Try turning off the %1$s option under the %2$s tab above.'=>'Deine Feed-URL scheint HTTP-Basic-Authentication-Anmeldeinformationen zu enthalten. Versuche, die Option %1$s unter dem Reiter %2$s oben zu deaktivieren.','Use legacy feed request method'=>'Alte Feed-Anforderungsmethode verwenden','%1$sThis URL points to a file in your Media Library.%2$s While you should be able to use this URL in an %3$s shortcode, it will be a static snapshot of the calendar at the time the file was created, and will not reflect any future updates to the source calendar. Please see our %4$sUser Guide%5$s for instructions on obtaining your correct dynamic feed URL.'=>'%1$sDiese URL verweist auf eine Datei in deiner Mediathek%2$s Du kannst diese URL zwar in einem %3$sShortcode verwenden, aber es handelt sich dabei um einen statischen Schnappschuss des Kalenders zum Zeitpunkt der Erstellung der Datei, der keine zukünftigen Aktualisierungen des Quellkalenders enthält. In unserem %4$sBenutzerhandbuch%5$s findest du Anweisungen, wie du die korrekte URL für deinen dynamischen Feed erhältst.','Error: Could not resolve IP address for %1$s.'=>'Fehler: IP-Adresse für %1$s konnte nicht aufgelöst werden.','Resolved IP address for %1$s:'=>'Aufgelöste IP-Adresse für %1$s:','The text entered in the "Default shortcode" field is not a valid shortcode, and was not saved.'=>'Der im Feld "Standard-Shortcode" eingegebene Text ist kein gültiger Shortcode und wurde nicht gespeichert.','%1$sSettings updated.%2$s You may need to refresh the page to see some changes.'=>'%1$sDie Einstellungen wurden aktualisiert.%2$s Möglicherweise musst du die Seite aktualisieren, um einige Änderungen zu sehen.','calendar event'=>'Kalender-Termin','The legacy feed request method is deprecated, and will be removed in an update in the near future. Please test your feeds with the legacy feed request method turned off.'=>'Die alte Feed-Anforderungsmethode ist veraltet und wird in naher Zukunft mit einem Update entfernt werden. Bitte testen Sie Ihre Feeds mit der deaktivierten Methode der alten Feed-Anforderung.','Map'=>'Karte','Recurring event'=>'Sich wiederholender Termin','Recurs every %1$s years'=>'Tritt alle %1$s Jahre auf','Recurs yearly'=>'Wiederholt sich jährlich','Recurs every %1$s months'=>'Wiederkehrend alle %1$s Monate','Recurs monthly'=>'Wiederholt sich monatlich','Recurs every %1$s weeks'=>'Tritt alle %1$s Wochen auf','Recurs weekly'=>'Wiederholt sich wöchentlich','Recurs every %1$s days'=>'Wiederkehrend alle %1$s Tage','Recurs daily'=>'Wiederholt sich täglich','The "url" property in your %1$s shortcode appears to contain HTML tags; most likely your URL has been turned into a clickable link. Your calendar may not display properly as a result. Please remove the clickable link in the shortcode.'=>'Die Eigenschaft "url" in deinem %1$s-Kurzcode scheint HTML-Tags zu enthalten; höchstwahrscheinlich wurde deine URL in einen klickbaren Link verwandelt. Dadurch wird dein Kalender möglicherweise nicht richtig angezeigt. Bitte entferne den klickbaren Link im Shortcode.','The r34ics_url_get_contents() function is no longer supported.'=>'Die Funktion r34ics_url_get_contents() wird nicht mehr unterstützt.','%1$sPlease note:%2$s %3$s version 10.6 changes the default options for several shortcode settings. In order to maintain consistency, these new defaults are %4$snot%5$s enabled when upgrading from an earlier version. If you would like to learn more about the changes please read our %6$sblog post%7$s, or to switch to the new defaults, turn on the %8$s option on the %9$s settings%10$s page.'=>'%1$sBitte beachte:%2$s %3$s Version 10.6 ändert die Standardoptionen für mehrere Shortcode-Einstellungen. Um die Konsistenz zu wahren, werden diese neuen Standardeinstellungen %4$snicht%5$s aktiviert, wenn du von einer früheren Version aktualisierst. Wenn du mehr über die Änderungen erfahren möchtest, lies bitte unseren %6$sBlogbeitrag%7$s. Um zu den neuen Standardeinstellungen zu wechseln, aktiviere die %8$sOption auf der %9$sEinstellungsseite%10$s.','Use new parameter defaults (v.10.6)'=>'Neue Parameter-Standardwerte verwenden (v.10.6)','%1$sPlease note:%2$s %3$s version 11.0 streamlines the way ICS feed URLs are retrieved. This change uses a standard built-in WordPress function, so it should be fully compatible with all existing installations. If you encounter any new issues after upgrading to version 11 or later, please visit the %4$sWordPress Support Forums%5$s for assistance.'=>'%1$sBitte beachte:%2$s %3$s Version 11.0 optimiert die Art und Weise, wie ICS-Feed-URLs abgerufen werden. Diese Änderung nutzt eine standardmäßig eingebaute WordPress-Funktion, so dass sie mit allen bestehenden Installationen vollständig kompatibel sein sollte. Wenn du nach dem Upgrade auf Version 11 oder höher auf neue Probleme stößt, besuche bitte die %4$sWordPress Support-Foren%5$s, um Hilfe zu erhalten.','%1$sPlease note:%2$s %3$s version 11.5.14.2 introduces a new, more secure method for handling calendar parameters when loading via AJAX. Please clear any caching plugins you are using, to ensure that your calendars are loading properly with the new method.'=>'%1$sBitte beachten Sie:%2$s %3$s Version 11.5.14.2 führt eine neue, sicherere Methode zur Handhabung von Kalenderparametern beim Laden über AJAX ein. Bitte löschen Sie alle Caching-Plugins, die Sie verwenden, um sicherzustellen, dass Ihre Kalender mit der neuen Methode korrekt geladen werden.','Add %1$s'=>'Hinzufügen %1$s','Close'=>'Schliessen','ICS Feed URL:'=>'ICS Feed URL:','Be sure you are using a %1$ssubscribe%2$s URL, not a %3$sweb view%4$s URL.%5$s (Entering the URL directly in your web browser should download an %6$s file.)'=>'Vergewissere dich, dass du eine %1$ssubscribe%2$s URL und keine %3$sweb view%4$s URL verwendest.%5$s (Wenn du die URL direkt in deinen Webbrowser eingibst, wird eine %6$s Datei heruntergeladen)','Calendar Title:'=>'Kalendertitel:','Leave empty to use calendar&rsquo;s default title. Enter %1$s to omit title altogether.'=>'Leer lassen, um den Standardtitel des Kalenders zu verwenden. Gib %1$s ein, um den Titel ganz wegzulassen.','Calendar Description:'=>'Kalenderbeschreibung:','Leave empty to use calendar&rsquo;s default description. Enter %1$s to omit description altogether.'=>'Leer lassen, um die Standardbeschreibung des Kalenders zu verwenden. Gib %1$s ein, um die Beschreibung ganz wegzulassen.','View:'=>'Anzeigen:','month'=>'Monat','list'=>'Liste','week'=>'Woche','Count:'=>'Zählen:','Format:'=>'Format:','Leave %1$s blank to include all upcoming events. %2$s must be a standard %3$sPHP date format string%4$s.'=>'Lass %1$s leer, um alle anstehenden Ereignisse einzuschließen. %2$s muss ein standardmäßiger %3$sPHP-String im Datumsformat sein%4$s.','Show event descriptions %1$s(change to a number in inserted shortcode to set word limit)%2$s'=>'Ereignisbeschreibungen anzeigen %1$s(im eingefügten Shortcode in eine Zahl ändern, um ein Wortlimit festzulegen)%2$s','Show event locations %1$s(if available)%2$s'=>'Veranstaltungsorte anzeigen %1$s(falls verfügbar)%2$s','Show event organizers %1$s(if available)%2$s'=>'Organisatoren der Veranstaltung anzeigen %1$s(falls vorhanden)%2$s','%1$sNote:%2$s Additional %3$sdisplay options%4$s are available by manually editing the shortcode after insertion.'=>'%1$sHinweis:%2$s Zusätzliche %3$sAnzeigeoptionen%4$s sind verfügbar, wenn du den Shortcode nach dem Einfügen manuell bearbeitest.','Insert %1$s'=>'Einfügen %1$s','Do even more with %1$s!'=>'Machen Sie noch mehr mit %1$s!','Calendar Builder'=>'Kalender-Generator','Configure all calendar settings with an easy visual interface... no need to manually type shortcodes.'=>'Konfigurieren Sie alle Kalendereinstellungen über eine einfache visuelle Schnittstelle... Sie müssen keine Shortcodes manuell eingeben.','Additional Views and Enhanced Features'=>'Zusätzliche Ansichten und erweiterte Funktionen','New ways to display your calendar including Full, Up Next, Masonry, Month with Sidebar, Widget, and more. Additional capabilities are added to the core Month, Basic, List and Week views.'=>'Neue Möglichkeiten zur Anzeige Ihres Kalenders, einschließlich Vollansicht, Nächste Ansicht, Masonry, Monat mit Seitenleiste, Widget und mehr. Die Hauptansichten Monat, Basis, Liste und Woche wurden um zusätzliche Funktionen ergänzt.','Customizer'=>'Customizer','Easily modify your calendar color palettes, fonts, and more, site-wide.'=>'Du kannst die Farbpalette, die Schriftart und vieles mehr deines Kalenders ganz einfach ändern.','ICS Events'=>'ICS-Veranstaltungen','%1$sNew!%2$s Turns %3$s into a full calendar system. Create and manage events directly in WordPress and even integrate them seamlessly with your existing feeds.'=>'%1$sNeu!%2$s Verwandelt %3$s in ein vollständiges Kalendersystem. Erstelle und verwalte Veranstaltungen direkt in WordPress und integriere sie sogar nahtlos in deine bestehenden Feeds.','Visit %1$s to learn more.'=>'Besuchen Sie %1$s, um mehr zu erfahren.','Go PRO!'=>'PRO erwerben!','Getting Started'=>'Jetzt Beginnen','System Report'=>'Systembericht','Save Changes'=>'Änderungen speichern','Thank you for installing %1$s. Before creating your first calendar shortcode, please visit your %2$sGeneral Settings%3$s page and verify that your site language, timezone and date/time format settings are correct. See our %4$sUser Guide%5$s for more information.'=>'Vielen Dank für die Installation von %1$s. Bevor du deinen ersten Kalender-Shortcode erstellst, besuche bitte die Seite %2$sAllgemeine Einstellungen%3$s und überprüfe, ob die Einstellungen für Sprache, Zeitzone und Datums-/Zeitformat deiner Website korrekt sind. In unserem %4$sBenutzerhandbuch%5$s findest du weitere Informationen.','Quick Start Guide'=>'Schnellstart-Anleitung','An extensive %1$sUser Guide%2$s is available on our website. Below are some quick links to key resources in the documentation.'=>'Ein ausführliches %1$sBenutzerhandbuch%2$s ist auf unserer Website verfügbar. Im Folgenden findest du einige Links zu den wichtigsten Ressourcen in der Dokumentation.','General:'=>'Allgemeines:','General WordPress Settings'=>'Allgemeine WordPress-Einstellungen','%1$s Settings'=>'%1$s Einstellungen','Working with Shortcodes:'=>'Arbeiten mit Shortcodes:','Shortcode Overview'=>'Shortcode Übersicht','Shortcode Builder'=>'Shortcode Builder','Shortcode Parameters Reference'=>'Referenz der Shortcode-Parameter','Advanced Topics:'=>'Fortgeschrittene Themen:','FAQs and Tips'=>'FAQs und Tipps','CSS Guide'=>'CSS-Leitfaden','Developer Resources'=>'Ressourcen für Entwickler','GDPR'=>'DSGVO','Appearance'=>'Darstellung','Match calendar color palette to current Block Theme colors'=>'Anpassen der Farbpalette des Kalenders an die Farben des aktuellen Blockthemas','beta'=>'beta','Replaces the %1$s default neutral color palette with nearest matches from the current Site Editor Styles color palette or the %2$s file in your theme. Color selections are algorithmic, and some combinations may not pass accessibility contrast tests. This setting has no effect if you are using a "classic" theme that does not include a %3$s file.'=>'Ersetzt die neutrale Standardfarbpalette %1$s durch die nächstgelegenen Farben aus der aktuellen Farbpalette der Site-Editor-Stile oder der Datei %2$s in Ihrem Design. Die Farbauswahl erfolgt algorithmisch, und einige Kombinationen bestehen möglicherweise nicht den Kontrasttest für die Barrierefreiheit. Diese Einstellung hat keine Auswirkungen, wenn Sie ein "klassisches" Design verwenden, das keine %3$s-Datei enthält.','%1$sThis is currently a beta feature.%2$s It may require making some adjustments to your calendar settings or CSS for optimal display, especially if you have color-coded your feeds. Functionality is subject to change.'=>'%1$s Dies ist derzeit eine Betafunktion%2$s Es kann sein, dass Sie einige Anpassungen an Ihren Kalendereinstellungen oder CSS vornehmen müssen, um eine optimale Anzeige zu erreichen, insbesondere wenn Sie Ihre Feeds farblich kodiert haben. Die Funktionalität kann sich noch ändern.','Dark mode'=>'Dunkler Modus','Inverts color palette (light colors on a dark background). %1$sNote:%2$s Dark mode also automatically applies style changes similar to the %3$s and %4$s shortcode parameters, so you do not need to include them in your shortcode.'=>'Invertiert die Farbpalette (helle Farben auf dunklem Hintergrund). %1$sHinweis:%2$s Der dunkle Modus wendet auch automatisch Stiländerungen an, die den Shortcode-Parametern %3$s und %4$s ähneln, sodass Sie diese nicht in Ihren Shortcode aufnehmen müssen.','Loading'=>'Laden','Always use AJAX to render calendars (recommended)'=>'Verwende immer AJAX zur Darstellung von Kalendern (empfohlen)','When checked, all calendars will render via AJAX (asynchronously after the page loads). This is especially useful in conjunction with other caching plugins, or if your calendars contain a large number of events. Normally, calendar data is sent directly in the HTML of the initial page load unless AJAX has been specified in the shortcode.'=>'Wenn diese Option aktiviert ist, werden alle Kalender per AJAX gerendert (asynchron nach dem Laden der Seite). Dies ist besonders nützlich in Verbindung mit anderen Caching-Plugins oder wenn deine Kalender eine große Anzahl von Veranstaltungen enthalten. Normalerweise werden die Kalenderdaten direkt im HTML-Code beim ersten Laden der Seite gesendet, es sei denn, AJAX wurde im Shortcode angegeben.','Increase memory limit when rendering calendars'=>'Speicherlimit beim Rendern von Kalendern erhöhen','If your calendar is failing to load with an "out of memory" fatal error, try increasing the memory limit. A minimum of 512 MB is recommended. %1$s Notes: 1) Some hosting providers may not allow applications to override the server default setting. 2) It is not possible to set this option lower than the current default memory limit on your server.'=>'Wenn dein Kalender nicht geladen werden kann und die Fehlermeldung "kein Speicherplatz" erscheint, versuche, die Speichergrenze zu erhöhen. Ein Minimum von 512 MB wird empfohlen. %1$s Hinweise: 1) Manche Hosting-Provider erlauben es Anwendungen nicht, die Standardeinstellung des Servers zu überschreiben. 2) Es ist nicht möglich, diese Option niedriger einzustellen als das aktuelle Standard-Speicherlimit auf deinem Server.','deprecated'=>'abgelehnt','If your site has stopped retrieving feeds after the version 11 update, turn on this option to use the legacy request method. This feature is deprecated and will be removed in an update in the near future.'=>'Wenn Ihre Website seit dem Update auf Version 11 keine Feeds mehr abruft, aktivieren Sie diese Option, um die alte Abfragemethode zu verwenden. Diese Funktion ist veraltet und wird in naher Zukunft mit einem Update entfernt werden.','Default shortcode'=>'Standard-Shortcode','If your site will include a large number of similarly configured calendar shortcodes, you can enter a default "base" shortcode here with the parameters that should be the same for all of the calendars. Individual shortcodes on the site can then include only the parameters that are unique to that calendar, as such: %1$s Any parameters included in the individual shortcode will override what is set here.'=>'Wenn Ihre Website eine große Anzahl von ähnlich konfigurierten Kalender-Shortcodes enthält, können Sie hier einen Standard-"Basis"-Shortcode mit den Parametern eingeben, die für alle Kalender gleich sein sollen. Einzelne Shortcodes auf der Website können dann nur die Parameter enthalten, die für den jeweiligen Kalender eindeutig sind, z. B: %1$s Alle Parameter, die in den einzelnen Shortcodes enthalten sind, überschreiben die hier eingestellten Parameter.','Allow access to these hostnames that resolve to reserved IP addresses'=>'Erlaube den Zugriff auf diese Hostnamen, die zu reservierten IP-Adressen aufgelöst werden','If your calendar server is hosted on the same physical server as your website, is part of the same local network, or otherwise uses a %1$sreserved IP address%2$s, enter its hostname here to allow access. For multiple calendar servers, enter one hostname per line. See %3$sthe %4$s documentation%5$s for more information.'=>'Wenn dein Kalenderserver auf demselben physischen Server wie deine Website gehostet wird, Teil desselben lokalen Netzwerks ist oder anderweitig eine %1$sreservierte IP-Adresse%2$s verwendet, gib seinen Hostnamen hier ein, um den Zugriff zu ermöglichen. Bei mehreren Kalenderservern gibst du einen Hostnamen pro Zeile ein. Weitere Informationen findest du in %3$sder %4$sDokumentation%5$s.','Enter one hostname per line. Hostnames are the base domain name, not a full URL. %1$s For example, you would enter %2$s, not %3$s.'=>'Geben Sie einen Hostnamen pro Zeile ein. Hostnamen sind der Basisdomänenname, nicht eine vollständige URL. %1$s Sie würden zum Beispiel %2$s und nicht %3$s eingeben.','Caching'=>'Caching','Transient (cache) expiration'=>'Vorübergehender (Cache-)Verfall','seconds'=>'Sekunden','Sets how long calendar feed data should be cached on the server (WordPress transients) before reloading. Default is 3600 (1 hour).'=>'Legt fest, wie lange die Daten des Kalenderfeeds auf dem Server zwischengespeichert werden sollen (WordPress-Transienten), bevor sie neu geladen werden. Der Standardwert ist 3600 (1 Stunde).','Miscellaneous'=>'Sonstiges','Remove "Add ICS Calendar" button in Classic Editor'=>'Entfernen der Schaltfläche "ICS-Kalender hinzufügen" im klassischen Editor','By default, ICS Calendar adds an "Add ICS Calendar" button to the toolbar above the WYSIWYG editor when using Classic Editor. Check this box to remove the button. Has no effect on sites using the Block Editor (Gutenberg).'=>'Standardmäßig fügt der ICS-Kalender eine Schaltfläche "ICS-Kalender hinzufügen" zur Symbolleiste über dem WYSIWYG-Editor hinzu, wenn du den klassischen Editor verwendest. Aktiviere dieses Kästchen, um die Schaltfläche zu entfernen. Hat keine Auswirkungen auf Websites, die den Block Editor (Gutenberg) verwenden.','%1$s version 10.6 introduced new default values for several shortcode parameters. New installations automatically use the new default values, but upgraded installations will continue to use the old default values, unless this box is checked. Read more about these changes on %2$sour blog%3$s.'=>'%1$s Mit Version 10.6 wurden neue Standardwerte für mehrere Shortcode-Parameter eingeführt. Neue Installationen verwenden automatisch die neuen Standardwerte, aber aktualisierte Installationen verwenden weiterhin die alten Standardwerte, es sei denn, dieses Feld ist aktiviert. Mehr über diese Änderungen erfährst du auf %2$sunserem Blog%3$s.','Our complete user guide is available with full translation into dozens of languages on our website:'=>'Unser komplettes Benutzerhandbuch ist mit vollständiger Übersetzung in Dutzende von Sprachen auf unserer Website verfügbar:','For assistance, please use our %1$ssupport request form%2$s.'=>'Wenn du Hilfe brauchst, benutze bitte unser %1$sSupport-Anfrageformular%2$s.','When contacting support, please include the %1$sSystem Report%2$s from this page.'=>'Wenn du den Support kontaktierst, gib bitte den %1$sSystembericht%2$s von dieser Seite an.','Spread the word!'=>'Sagen Sie es weiter!','If you find %1$s useful, you can help support our continued growth and development with a %2$sfive-star review%3$s. Thank you!'=>'Wenn Sie %1$s nützlich finden, können Sie unser weiteres Wachstum und unsere Entwicklung mit einer %2$sFünf-Sterne-Bewertung%3$s unterstützen. Wir danken Ihnen!','%1$s Data Cache'=>'%1$s Daten-Cache','Clear Cached Calendar Data'=>'Zwischengespeicherte Kalenderdaten löschen','This will immediately clear all existing cached calendar data (purge transients), forcing WordPress to reload all calendars the next time they are viewed. Caching will then resume as before.'=>'Dadurch werden sofort alle vorhandenen zwischengespeicherten Kalenderdaten gelöscht, wodurch WordPress gezwungen wird, alle Kalender neu zu laden, wenn sie das nächste Mal angezeigt werden. Das Caching wird dann wie bisher fortgesetzt.','ICS Feed URL Tester'=>'ICS-Feed-URL-Tester','If you are concerned that the plugin is not properly retrieving your feed, you can test the URL here.'=>'Wenn du dir Sorgen machst, dass das Plugin deinen Feed nicht richtig abruft, kannst du die URL hier testen.','Enter feed URL...'=>'Feed-URL eingeben ...','Test URL'=>'Test-URL','Results:'=>'Ergebnisse:','%1$s received.'=>'%1$s erhalten.','This appears to be a valid ICS feed URL.'=>'Dies scheint eine gültige ICS-Feed-URL zu sein.','This does not appear to be a valid ICS feed URL.'=>'Dies scheint keine gültige ICS-Feed-URL zu sein.','Could not retrieve data from the requested URL.'=>'Daten von der angeforderten URL konnten nicht abgerufen werden.','An unknown error occurred while attempting to retrieve the requested URL.'=>'Beim Versuch, die angeforderte URL abzurufen, ist ein unbekannter Fehler aufgetreten.','Please copy the following text and include it in your message when emailing support.'=>'Bitte kopieren Sie den folgenden Text und fügen Sie ihn in Ihre E-Mail an den Support ein.','Also please include the %1$s shortcode exactly as you have it entered on the affected page.'=>'Bitte füge auch den %1$s Shortcode genau so ein, wie du ihn auf der betroffenen Seite eingegeben hast.','For your site security please do NOT post the System Report in the support forums.'=>'Um die Sicherheit deiner Website zu gewährleisten, poste den Systembericht bitte NICHT in den Support-Foren.','No events found.'=>'Keine Termine gefunden.','Previous Page'=>'Vorherige Seite','Next Page'=>'Nächste Seite','All Day'=>'Ganztägig','Today'=>'Heute','No events.'=>'Keine Termine.','No additional events this month.'=>'Keine zusätzlichen Termine in diesem Monat.','Last week'=>'Letzte Woche','This week'=>'Diese Woche','Next week'=>'Nächste Woche','ICS Calendar'=>'ICS Calendar','https://icscalendar.com'=>'https://icscalendar.com','Turn your Google Calendar, Microsoft Office 365 or Apple iCloud Calendar into a seamlessly integrated, auto-updating, zero-maintenance WordPress experience.'=>'Verwandle deinen Google Kalender, Microsoft Office 365 oder Apple iCloud Kalender in ein nahtlos integriertes, sich automatisch aktualisierendes und wartungsfreies WordPress-Erlebnis.','Room 34 Creative Services, LLC'=>'Room 34 Creative Services, LLC']];
